import image from "./img1.jpg"
import image2 from "./img2.jpg"
import image3 from "./img3.jpg"

const project = [
  {
    id: 1,
    name: "E-Assessment",
    imgURL:
     image,
    judul: "E-Assessment",
    deskripsi: "Simplify the evaluation of subjects such as basic graphic design"
  },
  {
    id: 2,
    name: "E-Maint",
    imgURL:
      image2,
    judul: "E-Maint",
    deskripsi: "Accelerate the asset maintenance filling process"
  },
  {
      id: 3,
      name: "Lumut Suliki",
        imgURL:
      image3,
    judul: "Lumut Suliki",
    deskripsi: "Simplify data management, as well as the leave and permissions operations"
  },
  
  
];

export default project;
